import {Route, Switch, Redirect} from 'react-route-dom'

import MainHeader from './components/layout/MainHeader';
import GreatQoutes from './pages/GreatQoutes'
import AddQoute from './pages/AddQoute'
import QouteDetails from './pages/QouteDetails'


function App() {
  return (


      <Switch>


        <Route path='/GreatQoutes' exact>
          <GreatQoutes/>          
        </Route>

        <Route path='/GreatQoutes/:QouteId' exact>
          <QouteDetails/>          
        </Route>

        <Route path='/AddQoute' exact>
          <AddQoute/>
        </Route>
      </Switch>

  );
}

export default App;


